import { joinFrom } from './../util/joinFrom';
import { createMember } from './../entity';
import { ApolloDatabaseAnnotationMember, Context } from '../resolvers';
import { AnnotationMember as ApolloAnnotationMember } from './../../../../types/resolvers-types';
import { Base } from './Base';
import logger, { Tags } from '../../../../shared/log/logger';

type AnnotationMemberRelatedIds = {
  userId?: string;
  annotationId?: string;
  memberId?: string;
};

export class AnnotationMember extends Base<
  ApolloDatabaseAnnotationMember,
  ApolloAnnotationMember,
  unknown
> {
  constructor(annotMember: ApolloDatabaseAnnotationMember, from: string, context: Context) {
    super({
      name: 'AnnotationMember',
      entity: annotMember,
      context,
      from,
      getters: {},
      remove: async (id) => await context.resolvers.Mutation.deleteAnnotationMember(id),
      update: async (newEntity) => await context.resolvers.Mutation.editAnnotationMember(newEntity.id, newEntity)
    });
  }

  static async create(userId: string, documentId: string, annotationId: string, lastRead: number | string, annotationCreatedAt: number, from: string, context: Context) {
    const member = await createMember<ApolloDatabaseAnnotationMember>({
      userId,
      documentId,
      annotationId,
      lastRead,
      annotationCreatedAt
    });
    let entity = await context.resolvers.Mutation.addAnnotationMember(member);
    if(!entity) {
      entity = member
    }
    logger.debug(`New Annotation Member Entity created:`, { tag: Tags.ENTITY, meta: entity });
    const newMember = new AnnotationMember(entity, joinFrom(from, 'AnnotationMember.create'), context);
    return newMember;
  }

  static async buildFromId(ids: AnnotationMemberRelatedIds, from: string, context: Context) {
    const { userId, annotationId, memberId } = ids;

    const memberIds = memberId ? [memberId] : undefined;

    const entity = (await context.resolvers.Query.annotationMembers({
      userId,
      annotationId,
      ids: memberIds
    }))?.[0];
    if(!entity) return null;
    const member = new AnnotationMember(entity, joinFrom(from, `AnnotationMember.buildFromId(${memberId})`), context);
    return member;
  }
}
